import React from 'react'
import Nav from '../Nav.js'

export default class LandingPage extends React.Component{
  render(){
    return(
      <div >
      <Nav />
        <div className="landing-page">
          <div className="columns1">
            <h2>Christine Gomez</h2>
            <p>missing image</p>
          </div>
          <div className="columns2">
            <p>Full Stack Developer passionate about debugging code. With a background in customer service. Very comfortable when working with other people to complete a greater task. Now in the web development industry, very excited to push limits and create bigger projects in a dev team.</p>
          </div>
        </div>
      </div>
    )
  }
}
